La lectura es una forma fantástica de aprender y está en nuestras manos que nuestros niños y niñas descubran el placer de la lectura.

Con motivo del Día del Libro, todo nuestro alumnado ha creado cuentos maravillosos a través de la imaginación de los más pequeños del colegio.

